void sysConf_init(void)
{
	uint32_t temp = 0; 
	uint32_t datatemp[PARA_NUMS];        // ÏµÍ³²ÎÊý»º´æ
	
	STMFLASH_Read(PARA_SAVE_ADDR,&temp,1);    // ¶Á³ö1¸öÊý¾Ýµ½temp
	if(temp != 0x45)     // ²ÎÊý»¹Î´±£´æµ½FLASH£¨µÚÒ»´ÎÔËÐÐ£©
	{
		// £¨first time£© init system configuration
		flir_conf.flir_sys_Bright = Level3;         // Ä¬ÈÏÁÁ¶ÈµÈ¼¶       Level3
		flir_conf.flir_sys_Sleep  = Minutes_NA;     // Ä¬ÈÏSleep Time     Minutes_NA(²»¿ªÆôSleep¹¦ÄÜ)
		
		flir_conf.flir_sys_Focus = focus_enable;    // Ä¬ÈÏ¶Ô½¹×¼ÐÄ¿ªÆô
		flir_conf.flir_sys_Reticle[0] = 0;          // Reticle XÖáÆ«ÒÆ    ¶ÌÖá    (0,0)--½«¶Ô½¹×¼ÐÄ·ÅÔÚÆÁÄ»µÄÖÐÐÄÎ»ÖÃ
		flir_conf.flir_sys_Reticle[1] = 0;          // Reticle YÖáÆ«ÒÆ    ³¤Öá
		
		flir_conf.flir_sys_DisMode = color;         // Ä¬ÈÏÉãÏñÍ·Êý¾ÝÏÔÊ¾Ä£Ê½£º²ÊÉ«
		flir_conf.flir_sys_ComMode = disable;       // Ä¬ÈÏÖ¸ÄÏÕë¹¦ÄÜ¹Ø±Õ
		flir_conf.file_sys_PBWakeup= PBWakeup_None; // Ä¬ÈÏPBSTA¿ª»ú»½ÐÑÎ´°´ÏÂ
		flir_conf.file_sys_LowPower= Not_LowPower;  // µÚÒ»´Î¿ª»ú£¬·ÇStopµÍ¹¦ºÄÄ£Ê½
	}
	else
	{
		STMFLASH_Read(PARA_SAVE_ADDR+1,(uint32_t*)datatemp,PARA_NUMS-1);   // ¶Á³ö9¸öÏµÍ³²ÎÊý

		// init system configuration
		flir_conf.flir_sys_Bright = (BrightnessCont_sta)(datatemp[0]>>24);    // ÁÁ¶ÈµÈ¼¶   
		flir_conf.flir_sys_Sleep  = (SleepCont_sta)(datatemp[1]>>24);         // Sleep Time 
		
		flir_conf.flir_sys_Focus = (FocusCont_sta)(datatemp[2]>>24);          // ¶Ô½¹×¼ÐÄÊÇ·ñ¿ªÆô
		flir_conf.flir_sys_Reticle[0] = (int)((int)((datatemp[3])>>24)-50);   // Reticle XÖáÆ«ÒÆ    ¶ÌÖá  ¶Ô½¹×¼ÐÄÔÚÆÁÄ»ÉÏµÄÎ»ÖÃ
		flir_conf.flir_sys_Reticle[1] = (int)((int)((datatemp[4])>>24)-50);   // Reticle YÖáÆ«ÒÆ    ³¤Öá
		
		flir_conf.flir_sys_DisMode = (DisplayMode_sta)(datatemp[5]>>24);      // ÉãÏñÍ·Êý¾ÝÏÔÊ¾Ä£Ê½£¨²ÊÉ«/ºÚ°×£©
		flir_conf.flir_sys_ComMode = (CompassMode_sta)(datatemp[6]>>24);      // Ö¸ÄÏÕë¹¦ÄÜÊÇ·ñ¿ªÆô
		flir_conf.file_sys_PBWakeup= (PBWakeup_sta)(datatemp[7]>>24);         // ÊÇ·ñÎªPBSTA¿ª»ú»½ÐÑ
		flir_conf.file_sys_LowPower= (LowPower_sta)(datatemp[8]>>24);         // ±ê¼ÇÏµÍ³µ±Ç°×´Ì¬£ºStop Mode / Running
	}  
	
	if( (RCC->CSR & (0x01 << 29)) )                  // ¿´ÃÅ¹·¸´Î»£¨³ÌÐòÔËÐÐ³ö´í£©
	{
		__HAL_RCC_CLEAR_RESET_FLAGS();                 // Çå³ý¸´Î»±êÖ¾
		if(flir_conf.file_sys_LowPower == Is_LowPower) // Stop ModeÏÂ·¢ÉúµÄIWDG¸´Î»£¬ÖØÐÂ½øÈëStop Mode     
		{
			flir_conf.file_sys_LowPower = Is_LowPower;   // ×´Ì¬ÇÐ»»
			PBsetSandby();
		}
//		else                                           // Ó²¼þ¸´Î»£¨ÓÃ»§¿ª»ú»òÉÏµç£©
//		{
//			
//		}
	}
	// Ó²¼þ¸´Î»
	if(flir_conf.file_sys_PBWakeup == PBWakeup_Down) // PBSTA¿ª»ú»½ÐÑ
	{
		flir_conf.file_sys_PBWakeup= PBWakeup_None;    // Çå³ýPBSTA¿ª»ú»½ÐÑ°´¼ü
		
		if(!(GPIOB->IDR&0x0001))          // PB0°´ÏÂ  
		{
//			HAL_Delay(500);
//			HAL_Delay(500);
			HAL_Delay(500);
			if(GPIOB->IDR&0x0001)           // PB0¶Ì°´£¬²»¿ª»ú£¨ÖØÐÂ½øÈëStop Mode£©  
			{
				flir_conf.file_sys_LowPower = Is_LowPower;        // ×´Ì¬ÇÐ»»
				PBsetSandby();
			}
		}
		else                              // PB0ËÉÆð£¬²»¿ª»ú 
		{
			flir_conf.file_sys_LowPower = Is_LowPower;        // ×´Ì¬ÇÐ»»
			PBsetSandby();
		}
	}
	 // PB0³¤°´»ò¶ÏµçÇé¿öÏÂÉÏµç£¬¿ª»ú 
	flir_conf.file_sys_LowPower= Not_LowPower;  // ¿ª»ú£¬ÇÐ»»ÖÁ·ÇStopµÍ¹¦ºÄÄ£Ê½
	Time_Sleep = 0;                             // ÐÝÃß¶¨Ê±¼ÆÊýÆ÷¹éÁã
	switch((int)flir_conf.flir_sys_Sleep)
	{
		case (int)Minutes_3:
		case (int)Minutes_5:
		case (int)Minutes_10:
		case (int)Minutes_15:
			HAL_TIM_Base_Start_IT(&htim3);       // ¿ªÆô¶¨Ê±Æ÷TIM3ÖÐ¶Ï
			break;
		default :
			break;
	}
	//Save_Parameter();                            // ±£´æ9¸öÏµÍ³²ÎÊýµ½FLASH
}

