uint8_t mk;  //baterry flash counter

/*********************************************************************
 * @fn      Addbaterry_menu
 *
 * @brief   Add small baterry icon to screen
 *
 * @param   mode to charging or normal. value if quantity of baterry 
 *
 * @return  
 */
void Addbaterry_menu(Baterrymode mode,Quan_baterry value)
{
	//batery flash counter add by themself
	mk++;
	//juge the counter 
	if(mk > 29)
		mk = 1;
	if (mode == normal)
	{
		//does the value is equal to the Baterry_full
		if(value==Baterry_full)
			value = Baterry_high;
		if(value == Baterry_empty)   //if the value is equal to the Baterry_empty .The icon is flashing
		{
			if(mk > 15)
			{
				display_normal_baterry(value);	
			}
		}
		else  //display the icon
		{
			display_normal_baterry(value);	
		}
	}
	else if(mode == charging)  //if the mode id equal to charging .the icon is flashing
	{
		if(value == Baterry_full)
		{
			if(mk > 15)
			display_normal_baterry(Baterry_high);
			else
			display_normal_baterry(Baterry_middle);		
		}
		else if(value == Baterry_empty)
		{
			if(mk > 15)
			display_normal_baterry(Baterry_empty);
			else
			display_normal_baterry(Baterry_low);
		}
		else
		{
			if(mk > 15)
			display_normal_baterry( (Quan_baterry)(value+1) );
			else
			display_normal_baterry( (Quan_baterry)value );
		}
	}
}

/*********************************************************************
 * @fn      display_sleep_charging
 *
 * @brief   display baterry's picture when sleeping
 *
 * @param   value
 *
 * @return  
 */

void display_sleep_charging(Quan_baterry value)
{
	if(value == Baterry_full)
	{
		display_charging(Baterry_high);
		HAL_Delay(400);
		display_charging(Baterry_middle);
		HAL_Delay(400);
	}
	else if(value == Baterry_empty)
	{
		display_charging(Baterry_empty);
		HAL_Delay(400);
		display_charging(Baterry_low);
		HAL_Delay(400);
	}
	else
	{
		display_charging( (Quan_baterry)(value+1) );
		HAL_Delay(400);
		display_charging(value);
		HAL_Delay(400);
	}
}

/*********************************************************************
 * @fn      display_normal_baterry
 *
 * @brief   display baterry's picture
 *
 * @param   value
 *
 * @return  
 */
void display_normal_baterry(Quan_baterry value)
{
	uint8_t i,index;
	if(value==Baterry_full)
	value = Baterry_high;
	//display 1-4 row 
	for(index = 1;index < 4; index++)
	{
		for(i = 1; i < 22 ;i ++)
		{
			if(((BaterryScreen[(index * 24 + i) >> 3] >> (7 - (index * 24 + i)%8))&0x01) != 0x01)
					rowBuf[index+2][130+i]=0xE007;
		}
	}
	//display 4-11 row and juge the icon'length 
	for(index = 4;index < 11; index++)
	{
		for(i = 1; i < 18 - value * 5 ;i ++)
		{
	//		rowBuf[index+2][130+i] = (((BaterryScreen[(index * 24 + i) >> 3] >> (7 - (index * 24 + i)%8)) & 0x01)? BLACK:WHITE); 
			if(((BaterryScreen[(index * 24 + i) >> 3] >> (7 - (index * 24 + i)%8))&0x01) != 0x01)
					rowBuf[index+2][130+i]=0xE007;
		}
		for(i = 18 - value * 5; i < 18;i ++)
		{
		//	rowBuf[index+2][130+i] = BLACK;
		}
		for(i = 18;i < 22;i++)
		{
			if(((BaterryScreen[(index * 24 + i) >> 3] >> (7 - (index * 24 + i)%8))&0x01) != 0x01)
					rowBuf[index+2][130+i]=0xE007;
		}
	}
	//display the 11-14 row
	for(index = 11;index < 14; index++)
	{
		for(i = 1; i < 22 ;i ++)
		{
			if(((BaterryScreen[(index * 24 + i) >> 3] >> (7 - (index * 24 + i)%8))&0x01) != 0x01)
					rowBuf[index+2][130+i]=0xE007; 
		}
	}		
}

/*********************************************************************
 * @fn      display_charging
 *
 * @brief   display charging picture
 *
 * @param   value
 *
 * @return  
 */
void display_charging(Quan_baterry value)
{
	uint16_t index;
	uint16_t i;

	uint8_t menuTHstart, menuTHend;

	
	// get ready to start
	LCD_SetCursor(0,0);
	// start writing command
	LCD_WriteRAM_Prepare();	

	// set cousor
	LCD_SetCursor(0,0);
	
	// prepare to write
	LCD_WriteRAM_Prepare();     
  SPILCD_RS_SET;	

	
	// define the start threshold
	if((uint8_t)(value) <  (CH_CONTENT))
	{
		// use the enum define to get the const array value
		menuTHstart = chargTH[(uint8_t)(value)]; ;
	}

	
	// use the enum define to get the const array value
	menuTHend = chargTH[0];
	
	
	// block sending
	for(index = 0; index < LCD_CLEAR_ROUND; index ++)
	{
		for(i = 0; i < (SCREEN_SET_BUFSIZE/2); i++)
		{
			if((i < menuTHstart) || (i > menuTHend))
			{
				// get clear buffer ready
				screenSet[2 * i] = (uint8_t)(((chargebattery[(index * (SCREEN_SET_BUFSIZE/2) + i) >> 3] >> (7 - (index * (SCREEN_SET_BUFSIZE/2) + i)%8)) & 0x01)? BLACK:WHITE); 	
				screenSet[2 * i + 1] = screenSet[2 * i];
			}
			else
			{
				//display color according to menu selection
				if(index>40&&index<91)
				{
					// black color
					screenSet[2 * i] = (uint8_t)(BLACK);
					screenSet[2 * i + 1] = screenSet[2 * i];
				}
				else if((chargebattery[(index * (SCREEN_SET_BUFSIZE/2) + i) >> 3] >> (7 - (index * (SCREEN_SET_BUFSIZE/2) + i)%8)) & 0x01)
				{
					// black color
					screenSet[2 * i] = (uint8_t)(BLACK);
					screenSet[2 * i + 1] = screenSet[2 * i];
				}
				else
				{
					// selected color
					screenSet[2 * i] = (uint8_t)(WHITE);
					screenSet[2 * i + 1] = (uint8_t)(WHITE);
				}
			}
		}
		
		HAL_SPI_Transmit_DMA(&hspi1, (uint8_t*)screenSet, SCREEN_SET_BUFSIZE);
		// polling for 10ms by defaul
		HAL_DMA_PollForTransfer(&LCD_DMA_PORT,HAL_DMA_FULL_TRANSFER,1);		
	}
}	

